import React, { useState } from "react";



function Card(character) {
  console.log(character.name)
  var {name} = character;
  console.log(name)
  
  
  return (
    <div className="Card">
     <div>Name: {} </div>
    <div>Power Level: {}</div>
     <div>Age: {} </div>

    </div>
  );
}
 
export default Card;
